Let $\langle P, \leq_P \rangle$ and $\langle Q, \leq_Q \rangle$ be [3rb posets]. Then a function $\phi : P \rightarrow Q$ is said to be **monotone** (alternatively, **order-preserving**) if for all $s, t \in P$, $s \le_P t$ implies $\phi(s) \le_Q \phi(t)$.

Positive example
------

![A simple monotone map phi](http://i.imgur.com/6w11VT2.png)

